import React from 'react';
import { Link } from 'react-router-dom';
const Home = () => {
  return (
    <>
      <header>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About </Link>
            </li>
            <li>
              <Link to="/contact">Contact</Link>
            </li>
          </ul>
        </nav>
      </header>
      <h1>My Home Page</h1>
    </>
  );
};

export default Home;

// NavLink Component in React Router:

// NavLink component ki help se ham active class ko get kar sakte hai, isse hamne jis link par click kiya hoga ya jis link par honge uska color and other thing change kar sakte hai.
